description:
Dilemme is the less censored Big Brother Like show that has ever been broadcast on French Television. Nudity and Sex were shown on the live streams. Caroline and Jason fucked almost every day in the bedroom or toilets, there were blowjobs, etc. 

The show ended up being censored because the CSA (French TV regulator) was unhappy with a scene were a girl was treated like a dog. The show got into more problems when Endemol decided to sue the producers for copying their Big Brother concept. But Endemol lost the case in 2012 in appeal. The producers of Dilemme are free to make a sequel but prefered to rely on crappy scripted reality shows that cost less money and get higher ratings.

Since 2010 there is no Reality TV program in France with a live stream. Dilemme was the last (only exception is La Maison du Bluff but it's actually a poker show).


